import React, { useState, useEffect } from "react";
import axios from "axios"; // Import the Axios HTTP client

export default function Generate() {
  const [data, setData] = useState(0); // Initialize the state variable to hold the data

  const handleClick = () => {
    // Send a GET request to the server to retrieve the data from the database
    axios
      .get("http://localhost:5000/api/gets", {
        params: { type: "pant", color: "blue" },
      })
      .then((response) => {
        console.log("red");
        console.log(response);
        //setData(response.data); // Update the state variable with the data
      })
      .catch((error) => {
        console.error(error);
      });
  };
  return (
    <div>
      <button onClick={handleClick}>Get Data</button>
      {data && <textarea value={data} />}{" "}
      {/* Display the data in a textbox if it has been retrieved */}
    </div>
  );
}
